import React from 'react';
import { Routes, Route, Link, useParams } from 'react-router-dom';
import SeriesMatches from './SeriesMatches';
import SeriesTeams from './SeriesTeams';
import SeriesStandings from './SeriesStandings';

export default function Series() {
  const { id } = useParams();

  return (
    <div className="series-container">
      <div className="series-nav">
        <Link to={`/series/${id}/matches`} className="series-link">Matches</Link>
        <Link to={`/series/${id}/teams`} className="series-link">Teams</Link>
        <Link to={`/series/${id}/standings`} className="series-link">Standings</Link>
      </div>
      <Routes>
        <Route path="matches" element={<SeriesMatches />} />
        <Route path="teams" element={<SeriesTeams />} />
        <Route path="standings" element={<SeriesStandings />} />
      </Routes>
    </div>
  );
}
